import Navbar from './components/Navbar'
import Sidebar from './components/Sidebar'

export default class App extends Component {
    state = {
        sidebar: true,
        dropdown: false
    }

    render() {
        return (
            <>
                <Navbar app={this} />
                <Sidebar state={this.state} />
            </>
        )
    }
}
